import React from 'react';
import ReactDOM from 'react-dom';
import { View, Panel, PanelHeader } from '@vkontakte/vkui';

import Tabbar from './panels/Tabbar';

class App extends React.Component {

render() {
  return (
    <View>
      <Panel>
        <PanelHeader>Главная</PanelHeader>
       <Tabbar />
        </Panel>
      </View>
  )
}
}
 export default App;
